import './leftbar.css'
import { RssFeed } from "@mui/icons-material";

const Leftbar = () => {
  return (
    <div className='leftbarContainer'>
        <div className="leftbarWrapper">
              <ul className="leftbarList">
                  <li className="leftbarListItem">
                      RssFeed
                  </li>
              </ul>
        </div>
    </div>
  )
}

export default Leftbar
